INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 1, 1001, "春咲 ひより", 0, "お！\nあそこに困ってそうな人発見！", 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 1, 1002, "草野 優衣", 0, "大切な人を\n守れるようになりたい…って", 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("少しは磨かれると思いますよ。", 1, 1, 1003, "士条 怜", 0, "キミに必要な集中力と感性が", 1, 0, "フェンシングを始めてみては？", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", 1, 1, 1004, "穂高 みそぎ", 0, "今日はなにして遊ぶ？", 1, 0, "ねぇ、にいちゃん！", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("私といっしょに…\nいかない？", 1, 1, 1006, "風宮 あかり", 0, "ねぇ…", 1, 0, "風宮あかりです", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("食べ物の恨みは怖いのー", 1, 1, 1007, "出雲 宮子", 0, "プリンたべたいのー", 1, 0, "出雲宮子なのー", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("いいよ。\n見られることは運命さ…", 1, 1, 1008, "虹村 雪", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, "ボクは虹村雪。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("人呼んで「疾風の冥姫」!!", 1, 1, 1009, "柊杏奈", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, "フッ…聞いて後悔するがいい！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ほんまおおきにやわ～♪", 1, 1, 1010, "姫宮 真歩", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ここで会ったが\n100年目～！", 1, 1, 1011, "衣之咲 璃乃", 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, "衣之咲璃乃です！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", 1, 1, 1012, "柏崎 初音", 0, "ち、超能力って…\n何のことかな～？", 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 1, 1016, "美波 鈴奈", 0, "一応カリスマ読モJKやってまっす！", 1, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("でも、沖縄もとってもいいとこさー", 1, 1, 1017, "喜屋武 香織", 0, "東京は遊園地みたいなところさー", 1, 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("イオちゃんって呼んでね。", 1, 1, 1018, "支倉 伊緒", 0, "先生って呼ばれるのは\nくすぐったいから", 1, 0, "支倉伊緒です。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ミミをおいてかないでぇ～", 1, 1, 1020, "茜 ミミ", 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ふぇぇぇぇぇん……", 1, 1, 1021, "栗林 くるみ", 0, "あの……\nふぇ……", 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("なんてありがとうございます！", 1, 1, 1022, "風宮 より", 0, "こんな私に貴重な時間を\n割いていただき、", 1, 0, "風宮よりです。\nあああああ！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("私こっち行きたいー\nね、早く早くー", 1, 1, 1023, "北条 綾音", 0, "おにいちゃんどこいくの？\nえ？", 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("これて何か違う…\nあああすみません！", 1, 1, 1025, "天野 すずめ", 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("離しませんわ………\n絶対に…!!", 1, 1, 1027, "倉石 恵理子", 0, "あなたは…運命の……\n伴侶……", 1, 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("…そうでしょ？？", 1, 1, 1028, "佐々木 咲恋", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("あはは、\n私もまだまだだなぁ～", 1, 1, 1029, "桜井 望", 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, "桜井望だよ！\nよろしくねっ", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", 1, 1, 1030, "ニノン・ジュベール", 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, "デケデケデンっ！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("おかしいですね……", 1, 1, 1031, "上喜 しのぶ", 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("そう、\nオラのボケに突っ込める相方が…！", 1, 1, 1033, "野戸まひる", 0, "けんども\nそれには足りないモンが…", 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ちょ\nちょっと一杯飲んできます…！", 1, 1, 1034, "綾瀬 ゆかり", 0, "ちょっと緊張しちゃって…", 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("これ以上お話しすることは…\nないです！", 1, 1, 1036, "氷川 鏡華", 0, "知らない人とは話しちゃいけないので", 1, 0, "氷川鏡華…です", 0, 0, 2, 1.5, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 1, 1038, "柏崎 栞", 0, "……あ、アラーム。", 1, 0, "柏崎…栞です。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("野に咲く花が、\n唯一の話相手です。", 1, 1, 1040, "双葉 碧", 0, "私、一人も友達がいなくて……", 1, 0, "ふ、双葉碧です。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("そう思っています。", 1, 1, 1042, "三角 千歌", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, "三角千歌です。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("う、疑ってすまなかったな…", 1, 1, 1043, "安芸 真琴", 0, "あぁ？\nお前のそいつの仲間か？", 1, 0, "安芸真琴だ。", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 1, 1044, "イリヤ・オーンスタイン", 0, "生けとし生ける全ての者よ！", 1, 0, "わらわこそは夜を総べる者！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("ｌク、クウカに何かご用ですか!?", 1, 1, 1045, "遠見 空花", 0, "ぐふふふふ……はっ！", 1, 0, "そこで騎士は妖精を乱暴に……", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("う～ん…\n猫ってホントに最高にゃ～♪", 1, 1, 1046, "宮坂たまき", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 1, 1048, "大神 美冬", 0, "それでは早速クエストに…", 1, 0, "大神美冬よ！", 0, 0, 2, 1.4, 0);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES ("お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 1, 1049, "星野静流", 0, "クエストもバトルも\n掃除も洗濯も", 1, 0, "星野静流だよ！", 0, 0, 2, 1.4, 0);
